import React from "react";
import { useNavigate } from "react-router-dom";

function Dashboard() {
  const navigate = useNavigate();

  // Example: Check for token (simple auth check)
  const token = localStorage.getItem("token");

  return (
    <div className="min-h-screen bg-gray-50 flex flex-col">
      <nav className="bg-gray-900 text-white flex justify-between items-center px-6 py-4 shadow-md">
        <span className="text-xl font-extrabold tracking-wide">
          USK BROKERING
        </span>
        <div className="space-x-6 text-sm font-medium">
          {token ? (
            <button
              onClick={() => {
                localStorage.removeItem("token");
                window.location.reload();
              }}
              className="hover:underline"
            >
              Logout
            </button>
          ) : (
            <button
              onClick={() => navigate("/login")}
              className="hover:underline"
            >
              Login
            </button>
          )}
        </div>
      </nav>

      <main className="flex-grow pt-6 px-6 max-w-7xl mx-auto w-full">
        <section className="bg-white rounded-xl shadow-lg p-12 mb-10 text-center">
          <h1 className="text-4xl font-bold text-blue-700 mb-3">
            Welcome to USK BROKERING
          </h1>
          <p className="text-gray-700 max-w-3xl mx-auto mb-8">
            Professional trading platform with real-time market data, advanced
            order management, and comprehensive portfolio tracking.
          </p>
          {!token && (
            <button
              onClick={() => navigate("/login")}
              className="bg-gradient-to-r from-purple-600 to-blue-600 text-white py-3 px-7 rounded-lg font-semibold shadow-lg hover:opacity-90 transition"
            >
              Login
            </button>
          )}
          {token && (
            <p className="text-green-600 font-semibold mt-4">
              You are logged in.
            </p>
          )}
        </section>
        {/* Add your extended dashboard UI here */}
      </main>
    </div>
  );
}

export default Dashboard;
